  [],\n\t\"revision_timestamp\": \"2015-06-03T02:49:14.096655\",\n\t\"name\": \"eaarl-topography-george-washington-birthplace-national-monument-2008c6feb\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A first surface/bare earth elevation map
  (also known as a Digital Elevation Model, or DEM) of the George Washington Birthplace
  National Monument in Virginia was produced from remotely sensed, geographically
  referenced elevation measurements cooperatively by the U.S. Geological Survey (USGS),
  the National Park Service (NPS), and the National Aeronautics and Space Administration
  (NASA). Elevation measurements were collected over the area using the NASA Experimental
  Advanced Airborne Research Lidar (EAARL), a pulsed-laser ranging system mounted
  onboard an aircraft to measure ground elevation, vegetation canopy, and coastal
  topography. The system uses high-frequency laser beams directed at the Earth's surface
  through an opening in the bottom of the aircraft's fuselage. The laser system records
  the time difference between emission of the laser beam and the reception of the
  reflected laser signal in the aircraft. The plane travels over the target area at
  approximately 50 meters per second at an elevation of approximately 300 meters.
  The EAARL, developed by NASA at Wallops Flight Facility in Virginia, measures ground
  elevation with a vertical resolution of 15 centimeters. A sampling rate of 3 kilohertz
  or higher results in an extremely dense spatial elevation dataset. Over 100 kilometers
  of coastline can be easily surveyed within a 3- to 4-hour mission. When subsequent
  elevation maps for an area are analyzed, they provide resource managers with a useful
  tool regarding land development. For more information on Lidar science and the Experimental
  Advanced Airborne Research Lidar (EAARL) system and surveys, see http://ngom.usgs.gov/dsp/overview/index.php
  and http://ngom.usgs.gov/dsp/tech/eaarl/index.php .\",\n\t\"license_title\": null,\n\t\"extras\":
